import React from 'react'
import {NavLink} from 'react-router-dom'
import '../static/css/nav.css'
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css'
// import Navbar from 'react-bootstrap/Navbar'
// import NavDropdown from 'react-bootstrap/NavDropdown'
//import { LinkContainer } from 'react-router-bootstrap'

const Navbar = () =>{
	return (
			<div className="container">
				<nav className="navbar navbar-expand-lg navbar-light bg-light">
					<NavLink to="/" >Aashish Panthi</NavLink>
					<ul className="ml-auto">
						<NavLink to="/" activeClassName="activeLink">Home</NavLink>
						<NavLink to="/about" activeClassName="activeLink">About</NavLink>
						<NavLink to="/service" activeClassName="activeLink">Service</NavLink>
						<NavLink to="/contact" activeClassName="activeLink">Contact</NavLink>
					</ul>
				</nav>
			</div>
	)
}

export default Navbar
